import React from 'react';

class Tile extends React.Component {

    constructor(props) {
        super(props);
        this.state = { date: new Date() }
    }

    render() {
        return <h1>HELLO WORLD, Es ist {this.state.date.toLocaleTimeString()}</h1>
    }

}
export default Tile;
